    return (
        <div className="public-page flex flex-row">
            <img className="h-[800px] w-1/4 object-cover" src="../images/background.png" alt="background" />
            <form className='m-auto w-1/3 flex-col flex gap-3'>
                <div className="flex">
                    <h2 className="text-2xl font-normal mb-12" id="heading">Good Morning &nbsp;</h2>
                    <h2 className="text-2xl text-lime-900 font-bold">John Doe</h2>
                </div>
                <div className="flex">
                    <a href="#" class="block max-w-sm p-6 bg-white border border-gray-200 rounded-lg shadow-sm hover:bg-gray-100 dark:bg-gray-800 dark:border-gray-700 dark:hover:bg-gray-700">

                        <h5 class="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">Noteworthy technology acquisitions 2021</h5>
                        <p class="font-normal text-gray-700 dark:text-gray-400">Here are the biggest enterprise technology acquisitions of 2021 so far, in reverse chronological order.</p>
                    </a>
                </div>


            </form>

        </div>
    );
}

